const Home = () => {

    const handleclick=()=>{
        console.log("hello");
    }

    // handleclick is a function made using an arrow function   
    // we can also use normal function
    // onclick is a event

    const handleClickAgain=(name,e)=>{
        console.log("hello "+name,e.target);
    }


    return ( 
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={handleclick}className="Btn">Click me </button>
            <button onClick={(e)=>handleClickAgain("mario",e)}className="Btn">Click me again </button>
        </div>
     );
}

export default Home;
